//import plugin
import React from 'react';
import { Link } from "react-router-dom";

//import style
import "../style/nomatch.css"
import Colousel from '../component/corousel';
import Navbar from '../component/navbar';

// untuk mengembalikan respon saat tidak ditemukan page yang sesuai
class Store extends React.Component{
    render(){
        return(
            <nav>
                <Navbar/>
                <Colousel/>
                <ul>
                <li class="nav-item">
                        <Link to="/Store" class="nav-link"> Semua</Link>
                </li>
                <li class="nav-item">
                        <Link to="/Store" class="nav-link"> Telaris</Link>
                </li>
                <li class="nav-item">
                        <Link to="/Store" class="nav-link"> Pedas</Link>
                </li>
                <li class="nav-item">
                        <Link to="/Store" class="nav-link"> Manis</Link>
                </li>
                <li class="nav-item">
                        <Link to="/Store" class="nav-link"> Masam</Link>
                </li>
                <li class="nav-item">
                        <Link to="/Store" class="nav-link"> Halal</Link>
                </li>
                </ul>
            </nav>
        )
    }
}

//mengeksport class NotMatch ke main-route.js
export default Store;
